// -----------------------------------------------------
// ---------------  HAMBURGER  -------------------------
// -----------------------------------------------------

function site_tm_hamburger() {
    "use strict";

    var hamburger = jQuery(".hamburger");
    var mobileMenu = jQuery(".site_tm_mobile_menu_wrap");

    hamburger.on("click", function () {
        var element = jQuery(this);

        if (element.hasClass("is-active")) {
            element.removeClass("is-active");
            mobileMenu.slideUp();
        } else {
            element.addClass("is-active");
            mobileMenu.slideDown();
        }
        return false;
    });
}

// -----------------------------------------------------
// ---------------    IMAGE TO SVG    ------------------
// -----------------------------------------------------

function site_tm_imgtosvg() {
    "use strict";

    jQuery("img.svg").each(function () {
        var jQueryimg = jQuery(this);
        var imgClass = jQueryimg.attr("class");
        var imgURL = jQueryimg.attr("src");

        jQuery.get(
            imgURL,
            function (data) {
                // Get the SVG tag, ignore the rest
                var jQuerysvg = jQuery(data).find("svg");

                // Add replaced image's classes to the new SVG
                if (typeof imgClass !== "undefined") {
                    jQuerysvg = jQuerysvg.attr("class", imgClass + " replaced-svg");
                }

                // Remove any invalid XML tags as per http://validator.w3.org
                jQuerysvg = jQuerysvg.removeAttr("xmlns:a");

                // Replace image with new SVG
                jQueryimg.replaceWith(jQuerysvg);
            },
            "xml"
        );
    });
}

// -----------------------------------------------------
// --------------    MAGNIFIC POPUP    -----------------
// -----------------------------------------------------

function site_tm_magnific_popup() {
    "use strict";

    jQuery(".open-popup-link").magnificPopup({
        type: "inline",
        midClick: true // Allow opening popup on middle mouse click. Always set it to true if you don't provide alternative source in href.
    });

    jQuery(".gallery").each(function () {
        // the containers for all your galleries
        jQuery(this).magnificPopup({
            delegate: "a", // the selector for gallery item
            type: "image",
            gallery: {
                enabled: true
            }
        });
    });
    jQuery(".gallery_zoom").each(function () {
        // the containers for all your galleries
        jQuery(this).magnificPopup({
            delegate: "a.zoom", // the selector for gallery item
            type: "image",
            gallery: {
                enabled: true
            },
            removalDelay: 300,
            mainClass: "mfp-fade"
        });
    });
    jQuery(".popup-youtube").each(function () {
        // the containers for all your galleries
        jQuery(this).magnificPopup({
            //type: 'iframe',
            disableOn: 700,
            type: "iframe",
            mainClass: "mfp-fade",
            removalDelay: 160,
            preloader: false,
            fixedContentPos: false
        });
    });
}

// -----------------------------------------------------
// --------------------    JARALLAX    -----------------
// -----------------------------------------------------

function site_tm_jarallax() {
    "use strict";

    jQuery(".jarallax").each(function () {
        var element = jQuery(this);
        var customSpeed = element.data("speed");

        if (customSpeed !== "undefined" && customSpeed !== "") {
            customSpeed = customSpeed;
        } else {
            customSpeed = 0.5;
        }

        element.jarallax({
            speed: customSpeed,
            automaticResize: true
        });
    });
}

