// filterable

function site_tm_portfolio() {
    "use strict";

    if (jQuery().isotope) {
        // Needed variables
        var list = jQuery(".site_tm_portfolio_list");
        var filter = jQuery(".site_tm_portfolio_filter");

        if (filter.length) {
            // Isotope Filter
            filter.find("a").on("click", function () {
                var selector = jQuery(this).attr("data-filter");
                list.isotope({
                    filter: selector,
                    animationOptions: {
                        duration: 750,
                        easing: "linear",
                        queue: false
                    }
                });
                return false;
            });

            // Change active element class
            filter.find("a").on("click", function () {
                filter.find("a").removeClass("current");
                jQuery(this).addClass("current");
                return false;
            });
        }
    }
}

function site_tm_projects() {
    "use strict";

    jQuery(".site_tm_portfolio_animation_wrap").each(function () {
        jQuery(this)
            .on("mouseenter", function () {
                if (jQuery(this).data("title")) {
                    jQuery(".site_tm_portfolio_titles").html(
                        jQuery(this).data("title") +
                        '<span class="work__cat">' +
                        jQuery(this).data("category") +
                        "</span>"
                    );
                    jQuery(".site_tm_portfolio_titles").addClass("visible");
                }

                jQuery(document).on("mousemove", function (e) {
                    jQuery(".site_tm_portfolio_titles").css({
                        left: e.clientX - 10,
                        top: e.clientY + 25
                    });
                });
            })
            .on("mouseleave", function () {
                jQuery(".site_tm_portfolio_titles").removeClass("visible");
            });
    });
}

