// -----------------    PROGRESS BAR    ----------------
// -----------------------------------------------------

function tdProgress(container) {
    "use strict";

    container.find(".site_tm_progress").each(function (i) {
        var progress = jQuery(this);
        var pValue = parseInt(progress.data("value"), 10);
        var pColor = progress.data("color");
        var pBarWrap = progress.find(".site_tm_bar_wrap");
        var pBar = progress.find(".site_tm_bar");
        pBar.css({
            width: pValue + "%",
            backgroundColor: pColor
        });
        setTimeout(function () {
            pBarWrap.addClass("open");
        }, i * 500);
    });
}
jQuery(".site_tm_progress_wrap").each(function () {
    "use strict";
    var pWrap = jQuery(this);
    pWrap.waypoint({
        handler: function () {
            tdProgress(pWrap);
        },
        offset: "90%"
    });
});

// -----------------------------------------------------
// -----------------    MINI BOXES    ------------------
// -----------------------------------------------------

function site_tm_miniboxes() {
    "use strict";

    var el = jQuery(".site_tm_miniboxes");

    if (el.length) {
        el.each(function (index, element) {
            var child = jQuery(element).find(".site_tm_minibox");

            child.css({
                height: "auto"
            });
            // Get an array of all element heights

            var W = jQuery(window).width();
            if (W > 480) {
                var elementHeights = child
                    .map(function () {
                        return jQuery(this).outerHeight();
                    })
                    .get();

                // Math.max takes a variable number of arguments
                // `apply` is equivalent to passing each height as an argument
                var maxHeight = Math.max.apply(null, elementHeights);

                // Set each height to the max height
                child.css({
                    height: maxHeight + "px"
                });
            }
        });
    }
}

