// --------------------    TOTOP    --------------------
// -----------------------------------------------------

function site_tm_totop() {
    "use strict";

    jQuery(".site_tm_totop").on("click", function (e) {
        e.preventDefault();
        jQuery("html, body").animate({
            scrollTop: 0
        }, "slow");
        return false;
    });
}

function site_tm_totop_myhide() {
    "use strict";

    var toTop = jQuery(".site_tm_totop");
    if (toTop.length) {
        var topOffSet = toTop.offset().top;

        if (topOffSet > 1000) {
            toTop.addClass("opened");
        } else {
            toTop.removeClass("opened");
        }
    }
}
