// -------------    WIDGET MENU SCROLL -----------------
// -----------------------------------------------------

function site_tm_popupscroll() {
    "use strict";

    var H = jQuery(window).height();
    var scrollable = jQuery(".scrollable");

    var popupBox = jQuery(".site_tm_popup_blog .inner_popup");

    popupBox.css({
        height: H - 100
    });

    scrollable.each(function () {
        var element = jQuery(this);
        var wH = jQuery(window).height();

        element.css({
            height: wH - 100
        });

        element.niceScroll({
            touchbehavior: false,
            cursorwidth: 0,
            autohidemode: true,
            cursorborder: "0px solid #fff"
        });
    });
}

