// -----------------------------------------------------
// -----------------    SWITCHER    --------------------
// -----------------------------------------------------

function site_tm_switcher() {
    "use strict";

    var switcherOpener = jQuery(".site_tm_resize");
    var switcherIcon = jQuery(".site_tm_leftpart_wrap .site_tm_resize i");
    var leftPart = jQuery(".site_tm_leftpart_wrap");
    var rightPart = jQuery(".site_tm_rightpart");

    switcherOpener.on("click", function () {
        if (switcherOpener.hasClass("opened")) {
            switcherOpener.removeClass("opened");
            switcherIcon.removeClass("opened");
            leftPart.removeClass("opened");
            rightPart.removeClass("opened");
        } else {
            switcherOpener.addClass("opened");
            switcherIcon.addClass("opened");
            leftPart.addClass("opened");
            rightPart.addClass("opened");
        }
        setTimeout(function () {
            jQuery("#ripple").ripples("updateSize");
        }, 101);
        setTimeout(function () {
            jQuery("#ripple").ripples("updateSize");
        }, 201);
        setTimeout(function () {
            jQuery("#ripple").ripples("updateSize");
        }, 301);

        if (jQuery(".jarallax").length) {
            jQuery(".jarallax").jarallax("destroy");
            setTimeout(function () {
                site_tm_jarallax();
            }, 300);
        }
        return false;
    });
}

// -----------------------------------------------------
// -------------------    COUNTER    -------------------
// -----------------------------------------------------

jQuery(".site_tm_counter").each(function () {
    "use strict";

    var el = jQuery(this);
    el.waypoint({
        handler: function () {
            if (!el.hasClass("stop")) {
                el.addClass("stop").countTo({
                    refreshInterval: 50,
                    formatter: function (value, options) {
                        return value
                            .toFixed(options.decimals)
                            .replace(/\B(?=(?:\d{3})+(?!\d))/g, ",");
                    }
                });
            }
        },
        offset: "80%"
    });
});

