function site_tm_data_images() {
    "use strict";

    var data = jQuery("*[data-img-url]");

    data.each(function () {
        var element = jQuery(this);
        var url = element.data("img-url");
        element.css({
            backgroundImage: "url(" + url + ")"
        });
    });
}

